import React, { useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";

export default function UpdateEmployee() {
  const { state } = useLocation();
  const { employee } = state || {}; // Extract the employee details from state
  const navigate = useNavigate(); // For navigation after update

  const [formData, setFormData] = useState({
    first_name: employee?.first_name || "",
    last_name: employee?.last_name || "",
    email: employee?.email || "",
    position: employee?.position || "",
    department: employee?.department || "",
    salary: employee?.salary || "",
  });

  if (!employee) {
    return <p>No employee data found for updating.</p>;
  }

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const token = localStorage.getItem("accessToken");
      if (!token) {
        alert("You must be logged in to update employee details.");
        return;
      }

      const response = await fetch(`http://localhost:3000/api/v1/emp/employees/${employee._id}`, {
        method: "PUT",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(formData),
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.message || "Failed to update employee details.");
      }

      alert("Employee updated successfully!");
      navigate("/"); // Redirect to the employee list after updating
    } catch (error) {
      console.error("Error updating employee:", error);
      alert(`Error: ${error.message}`);
    }
  };

  return (
    <div>
      <h1>Update Employee</h1>

      {/* Back and Home buttons */}
      <div style={{ marginBottom: "20px" }}>
        <button onClick={() => navigate(-1)} style={{ marginRight: "10px" }}>
          Back
        </button>
        <button onClick={() => navigate("/")} style={{ marginLeft: "10px" }}>
          Home
        </button>
      </div>

      <form onSubmit={handleSubmit}>
        <label>
          First Name:
          <input
            type="text"
            name="first_name"
            value={formData.first_name}
            onChange={handleInputChange}
            required
          />
        </label>
        <br />
        <label>
          Last Name:
          <input
            type="text"
            name="last_name"
            value={formData.last_name}
            onChange={handleInputChange}
            required
          />
        </label>
        <br />
        <label>
          Email:
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleInputChange}
            required
          />
        </label>
        <br />
        <label>
          Position:
          <input
            type="text"
            name="position"
            value={formData.position}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Department:
          <input
            type="text"
            name="department"
            value={formData.department}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <label>
          Salary:
          <input
            type="number"
            name="salary"
            value={formData.salary}
            onChange={handleInputChange}
          />
        </label>
        <br />
        <button type="submit">Save Changes</button>
      </form>
    </div>
  );
}
